issues.body:
Hi,

I just found a bug in the ranges processing. Consider the following code snippet:

```
Semver semverVersion = new Semver("16.2.1");
if (semverVersion.satisfies("<=16")) {
    System.out.println("Expected output!");
} else {
    System.out.println("ERROR!");
}
```

The given version "16.2.1" is definitely in the range "<=16" by Semver rules, but still we see the ERROR output.

Best Regards,   
Steffen
